import React,{ Component } from 'react';
import './bodyallfile.css';
class Tableview extends React.Component{
    constructor(props){
        super(props)
        console.log(props.filer)
    }
    render(){
        return (
            <tr>
                <th scope="row"></th>
                <td>1</td>
                <td><a href="https://www.google.co.in/">Mark</a></td>
                <td>Otto</td>
                <td>@mdo</td>
                <td>Jpeg</td>
            </tr>
        )
    }
}

export default Tableview
